import React, { useEffect} from "react";
import axios from "axios";
import CityInfo from "./CityInfo";

const Results = () => {
  let city_info=[]
  const fetchProducts = async () => {
    const response = await axios
      .get("http://api.openweathermap.org/geo/1.0/direct?q=Aligarh,UP,IN&limit=1&appid=8daa67bc5aa6f4004f105953f01aadfd")
      .catch((err) => {
        console.log("Err: ", err);
      });
    city_info=response.data;
  };
  useEffect(() => {fetchProducts();});
  return (
    <div className="ui grid container center" >
      <CityInfo city_info={city_info}/>
    </div>
  );
};

export default Results;
